import React from "react";
import { Button, Col, Container, Row } from "react-bootstrap";
import { useNavigate } from "react-router-dom";
import "./StartPage.css"; // Asegúrate de crear este archivo para los estilos

const StartPage = () => {
  const navigate = useNavigate();

  const handleStartClick = () => {
    navigate("/home"); // Ajusta la ruta según sea necesario
  };

  return (
    <Container
      fluid
      className="vh-100 d-flex justify-content-center align-items-center start-page"
    >
      <Row>
        <Col className="text-center">
          <Button variant="primary" size="lg" onClick={handleStartClick}>
            Ver Pokémon
          </Button>
        </Col>
      </Row>
    </Container>
  );
};

export default StartPage;
